//autogenerated:yes
//nolint:revive,govet,errcheck
package marsh

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_MARSH_MODE_FLAGS(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e MARSH_MODE_FLAGS
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := MARSH_MODE_SINGLE_MESSAGE.MarshalText()
		require.NoError(t, err)

		var dec MARSH_MODE_FLAGS
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, MARSH_MODE_SINGLE_MESSAGE, dec)
	})
}
